import React from "react";
import { Card } from "./Card";

const data = [
  {
    id: 1,
    src: "https://wallpapercave.com/wp/wp4056410.jpg",
    category: "A Netflix Original Series",
    title: "DARK",
  },
];

const App = () => {
  return (
    <>
      <Card
        key={data.id}
        src={data.src}
        category={data.category}
        title={data.title}
      />
    </>
  );
};

export default App;
